import players from './JsonData/players.json'

var playerFirstNames = new Array(players.length);
var playerLastNames = new Array(players.length);
for (var i = 0; i < players.length; i++) {
    playerFirstNames[i] = players[i].first_name;
    playerLastNames[i] = players[i].last_name;
}
var allPlayers;
const axios = require('axios').default;

for (var j = 1; j <= 1; j++) {
    axios.get('https://www.balldontlie.io/api/v1/players?page=' + j + '&per_page=100')
        .then(function (response) {
            var pageOfPlayers = response.data;
            console.log(pageOfPlayers.data.length);
            for (var k = 0; k < pageOfPlayers.data.length; k++) {
                console.log(pageOfPlayers.data[k]);
            }
        })
        .catch(function (error) {
            //console.log(error);
        })
        .then(function () {
        });
}
